import "./Navbar.css";
const [isLoggedIn, setIsLoggedIn] = useState(
    !!localStorage.getItem("token")
  );
  
function Navbar() {
  return (
    <header className="navbar">
      <h3>Dashboard</h3>
      <div className="nav-actions">
        <span>Pratham</span>
        <button claas>Logout</button>
      </div>
    </header>
  );
}

export default Navbar;
